import { View, Text, StyleSheet, Image } from "react-native";

const ResultsScreen = () => {
  const products = [
    {
      url: "https://lp2.hm.com/hmgoepprod?set=quality%5B79%5D%2Csource%5B%2F0b%2F00%2F0b002bc3e55da21c571b24ace2399fc6f5bc9081.jpg%5D%2Corigin%5Bdam%5D%2Ccategory%5B%5D%2Ctype%5BLOOKBOOK%5D%2Cres%5Bm%5D%2Chmver%5B1%5D&call=url[file:/product/main]",
      title: "Relaxed Fit Felted Overshirt",
      price: 2699,
    },
  ];
  return (
    <View>
      {/* Render Product Component */}
      <View style={styles.root}>
        <Image
          style={styles.image}
          source={{
            uri: products[0].url,
          }}
        />
        <View>
          <Text style={styles.title}>{products[0].title}</Text>
          <Text style={styles.price}>Rs. {products[0].price}</Text>
        </View>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  root: {},
  image: {
    height: 300,
    width: 200,
    borderRadius: 18,
    marginBottom: 5,
  },
  title: {},
  price: {
    fontWeight: "bold",
  },
});

export default ResultsScreen;
